css:
@-moz-document regexp("http(s?)://(www.|)usenet-crawler(?:$|\\W).*") {
/* Site-wide html styles */

body {
    margin: 0 auto;
    padding: 0;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') repeat;
    font-family: Arial, Helvetica, sans-serif;
    font-size: 13px;
    color: #0081FF;
}
h1,
h2,
h3 {
    margin: 0;
    font-weight: normal;
    color: #FFF200;
}
input,
select,
textarea {
    font-family: Arial, Helvetica, sans-serif;
}
textarea {
    height: 50px;
    width: 300px;
}
h1 {
    font-size: 44px;
    padding-bottom: 10px;
}
h2 {
    padding-bottom: 5px;
    font-size: 1.6em;
}
h3 {
    padding: 10px 0 5px 0;
}
p,
ul,
ol {
    margin-top: 0;
    line-height: 240%;
    text-align: justify;
}

a {
    color: #00FF00;
    text-decoration: none;
}
a:hover {
    text-decoration: underline;
	color: #FFF200;
	border-color: #00ffc4;
}
a img {
    border: none;
}
img.left {
    float: left;
    margin: 7px 30px 0 0;
}
img.right {
    float: right;
    margin: 7px 0 0 30px;
}
hr {
    display: none;
}
input[type=text],
input[type=password],
input[type=email],
textarea,
select {
    border: 1px solid #178cff;
    border-bottom-color: #178cff;
    border-right-color: #178cff;
    margin: 0;
    padding: 4px;
    color: #00ffff;
    font-size: 100%;
    outline: none;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') repeat;
}
b {		
	color: #ff1493;
}
/*
page structure
*/

#header {
    width: 1200px;
    margin: 0 auto;
}
#page {
    width: 1200px;
    margin: 0 auto;
    padding: 50px 0px 0px 0px;
}
/*#logo {
    width: 1200px;
    margin: 0 auto;
    height: 65px;
    padding-left: 5px;
    margin-top: 4px;
    background: url("../images/ace-banner.jpg") no-repeat bottom left;
}*/
#logo h1,
#logo p {
    display: none;
    margin: 0px;
    line-height: normal;
    text-transform: lowercase;
    font-weight: normal;
    color: #485459;
}
#logo p {
    margin-top: 2px;
    font-size: 13px;
    color: #A8A8A8;
}
#logo h1 {
    padding-top: 10px;
    font-size: 48px;
}
#logo a {
    color: #A8A8A8;
}
#logo .logolink {
    float: left;
}
#logo img {
    margin-top: 15px;
}
#logo h1 a {
    color: #485459;
}
#statusbar {
    width: 1200px;
    margin: 0 auto;
    text-align: right;
    padding: 5px 10px 0 0;
}
#statusbar a {
    color: #FFF200;
}
#content {
    float: right;
    width: 1000px;
}
#content h1 {
    font-size: 2.3em;
}
#content p {
    margin-bottom: 20px;
}
#sidebar {
    float: left;
    width: 160px;
    margin-bottom: 20px;
    border-left: 1px solid #178cff;
    border-right: 1px solid #178cff;
    border-top: 1px solid #178cff;
    border-bottom: 1px solid #178cff;
}
#sidebar ul {
    margin: 0;
    padding: 0;
    line-height: normal;
    list-style-type: none;
    text-align: left;
	background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') repeat;
}
#sidebar li {
    margin-bottom: 30px;
    padding: 0 0 0 0;
}
#sidebar li ul {
    list-style-type: none;
    list-style-position: inside;
    margin: 0px 10px;
    padding: 0;
    margin-left: 1em;
}
#sidebar li li {
    background-image: url('data:image/jpeg;base64,');
    background-repeat: no-repeat;
    background-position: 0.7em 1.1em;
    margin: 0;
    padding-left: .5em;
    padding-top: .8em;
    padding-bottom: 10px;
    border-bottom: 1px solid #178cff;
}
#sidebar li li a {
    padding: 0 0 0 20px;
    font-weight: normal;
    color: #00FF00;
}
#sidebar li li a:hover {
    color: #FFF200;
}
#sidebar li li:hover {
    cursor: pointer;
    background-color: rgba(76, 175, 80, 0.0);
    background-image: url('data:image/jpeg;base64,');
}
#sidebar p {
    margin: 0;
    padding: 0px 14px;
}
#sidebar h2 {
    height: 30px;
    margin: 0 0 5px 0px;
    padding: 6px 0 2px 14px;
    font-size: 18px;
    font-weight: normal;
    color: #FFF200;
}
#sidebar p {
    line-height: 200%;
}
#sidebar a {
    text-align: left;
    text-decoration: none;
    font-weight: bold;
}
.w3validator img {
    margin: 10px 0 10px 0;
}
.footer {
    width: 100%;
    height: 102px;
    margin: 0 auto;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    border-top: 5px solid #656565;
}
.footer p {
    margin: 0;
    padding: 20px 0px 0px 0px;
    text-align: center;
    line-height: normal;
    font-size: 0.9em;
}

/*
browse by category top menu
*/

#menu {
    height: 33px;
    float: left;
    width: 1196px;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
}
#menu {
    padding: 0 0 0 4px;
    margin-right: 1px;
    border: 1px #CCC solid;
    border: 1px #fff200 solid;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    -moz-border-radius: 4px;
    -webkit-border-radius: 4px;
	border-radius: 4px;
}
.menupic {
    padding-left: 15px;
}
#menulink {
    float: left;
}
#menulink ul {
    list-style-type: none;
    padding: 0;
    margin: 0;
}
#menulink li {
    float: left;
    position: relative;
    z-index: 100;
}
#menulink a,
#menulink :visited {
    height: 32px;
    display: block;
    font-size: 1em;
    width: 96px;
    padding: 1px 0px 0px 5px;
    color: #0081FF;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') top;
    text-decoration: none;
    text-align: left;
}
#menulink :hover,
#menulink a.selected {
    color: #FFF200;
    background: #222222;
}
#menulink ul ul {
    visibility: hidden;
    position: absolute;
    width: 60px;
    height: 0;
}
#menulink ul li:hover ul,
#menulink ul a:hover ul {
    visibility: visible;
}
#menusearchlink {
    padding-top: 5px;
    float: right;
}
#menusearchlink input, 
#menusearchlink select {
    font-size: 0.9em;
    color: #ff1493;
}
#menucontainer {
    width: 1196px;
    height: 10px;
}
select#headcat {
    width: 120px;
    float: right;
    margin-left: 5px;
    height: 25px;
}
select#headcat option {
    padding-left: 10px;
}
select#headcat option.grouping {
    padding-left: 5px;
    font-weight: bold;
}
#headsearch {
    /*width: 110px;*/
    float: right;
	height: 15px;
}
select#headcat {
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') repeat;
}
.gobutton {
    display: inline;
    margin-left: 5px;
}
.gobutton input {
    background: url('data:image/png;base64,') no-repeat;
    cursor: pointer;
    border: none;
    width: 30px;
    height: 25px;
}
#headsearch_go:hover {
    background: url('data:image/png;base64,') no-repeat;
    cursor: pointer;
    border: none;
    width: 30px;
    height: 25px;
}
/* menu styling for when menu is displayed in top position  */

#logo ul {
    list-style-type: none;
    float: right;
    margin: 0 0 10px 0;
    padding: 0;
    line-height: normal;
    text-align: right;
}
#logo ul li h2 {
    display: none;
}
#logo ul li ul li {
    float: left;
    margin-left: 1em;
    padding-right: 5px;
}
#logo ul li a {
    color: #333;
}
#logo ul ul {
    list-style-type: square;
}
/*
data tables, most lists.
*/

#browsetable,
#coverstable,
#forumtable {
    margin-top: 10px;
    clear: both;
}
table.data {
    border-collapse: collapse;
}
table.data th {
    text-align: left;
    vertical-align: top;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    border-color: #178cff;
    border-width: 1px;
    border-style: solid;
    padding: 3px;
    font-weight: bolder;
    text-transform: capitalize;
}
table.data td {
    white-space: normal;
    vertical-align: top;
    padding: 5px;
    border-color: #178cff;
    border-width: 1px;
    border-style: solid;
}
table.data td.less {
    color: #00FFCF;
    font-size: 0.9em;
    white-space: nowrap;
}
table.data td.icons {
    white-space: nowrap;
    padding-left: 0px;
    padding-right: 0px;
    width: 60px;
}
table.data td.check {
    cursor: pointer;
}
table.highlight tr:hover td {
    background-color: #222222;
}
table tr.alt {
    background: #FFF url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') top;
}
table tr.new {
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    /*background-color: #f6f8ff;*/
}
table.data em {
    font-weight: bolder;
    color: red;
}
table td.item {
    padding: 5px 5px 2px 5px;
}
table td.static {
    background-color: #FFF;
}
.left {
    text-align: left !important;
}
.right {
    text-align: right !important;
}
.mid {
    text-align: center !important;
}
.nowrap {
    white-space: nowrap;
}
#detailstable {
    width: 70%;
}
#detailstable th {
    width: 70px;
}
table.innerdata {
    border-collapse: collapse;
}
table.innerdata td {
    padding: 2px;
    border-left-width: 0;
    border-bottom-width: 0;
    border-color: #EEE;
}
table.innerdata th {
    padding: 2px;
    border-style: none;
    background-color: #EEE;
}
table.input th,
table.input td {
    text-align: left;
    vertical-align: top;
}
/*
form inputs and helpers
*/
/*
pager
*/

div.pager {
    display: inline;
}
div.pager a {
    font-weight: bold;
    background-color: transparent;
    padding: 0 3px 0px 4px;
    border: 1px #CCC solid;
}
div.pager .current {
    color: #fff;
    font-weight: bold;
    background-color: #777;
    padding: 0 4px 0px 4px;
    border: 1px #CCC solid;
}
/*
round buttoning
*/

table.rndbtn {
    padding: 0 4px 0 4px;
    margin-right: 1px;
    border: 1px #178cff solid;
    /*background-color:#EEE*/
    
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    /*moz-border-radius: 4px;  -webkit-border-radius: 4px; border-radius: 4px;*/
}
.rndbtn {
    padding: 0 4px 0 4px;
    margin-right: 1px;
    border: 1px #d95252 solid;
    border-color: #178cff;    
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    -moz-border-radius: 4px;  
	-webkit-border-radius: 4px; 
	border-radius: 4px;
}
#author,
#xxxtitle,
#platform,
#title,
#movietitle,
#movieactors,
#moviedirector,
#musicartist,
#musictitle {
    color: #7727DB !important;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
	border: 1px solid #178cff;
}

table.highlight tr:hover .rndbtn:hover {
    background-color: #F9FF00;
}
table.highlight tr:hover td.static {
    background-color: #FFF;
}
/*
site wide covers and images with dropshadows
*/

img.shadow {
    padding: 5px 5px 5px 5px;
    background: #222222;
    border: 1px solid #222222;
    -moz-box-shadow: 3px 6px 8px -4px #777;
    -webkit-box-shadow: 3px 6px 8px -4px #777;
    box-shadow: 3px 6px 8px -4px #777;
    border-collapse: separate;
}
/*
mainly one-off styles used on individual pages
*/

#forumtable a.title {
    font-size: 1.4em;
}
pre#nfo {
    font-family: "Courier New", "DejaVu Sans Mono", monospace;
    font-size: 12px;
    line-height: 13px;
}
div.resextra {
    padding-top: 7px;
    color: #7727DB;
    font-size: 0.9em;
    height: 16px;
}
div.resextra a {
    color: #7727DB;
    text-decoration: none;
}
div.resextra div.admin {
    float: right;
}
div.resextra div.btns {
    float: left;
}
div.movextra {
    padding-top: 5px;
    color: #04f3ff;
    font-size: 0.9em;
}
div.movextra td {
    border: 0;
    padding: 0 0 10px 0
}
div.movextra tr.mlextra {
    display: none;
}
div.movcover {
    width: 140px;
}
div.movcover img {
    margin-bottom: 5px;
}
div.movcover .rndbtn {		
	display: inline-block;		
	margin-top: 2px;		
}
.mediainfo,
.seriesinfo,
.preinfo {
    cursor: pointer;
}
	div.rtcover {		
    width: 100px !important;		
}
a.external {
    background: url('data:image/png;base64,') center right no-repeat !important;
    padding-right: 13px !important;
}
ol.tracklist li {
    line-height: 140%;
}
div.tvseriesheading img {
    float: right;
    margin: 10px 0 10px 10px;
    max-width: 300px;
}
div.tvseriesheading p {
    text-align: left;
}
span.descfull {
    display: none;
}
a.descmore {
    display: inline;
	
    margin-left: 5px;
}
div.error {
    padding: 20px;
    padding-left: 50px;
    border: 1px solid #BBB;
    background: #FED0D0 url('data:image/png;base64,') no-repeat top;
    background-position: 5px 50%;
    font-size: 1.2em;
    font-weight: bold;
    margin-bottom: 10px;
}
div.comments {
    padding-top: 20px;
}
.invitesuccess {
    display: none;
    font-weight: bold;
    padding-left: 10px;
    color: green;
}
.invitefailed {
    display: none;
    font-weight: bold;
    padding-left: 10px;
    color: red;
}
div.nosearchresults {
    margin-left: 25px;
    padding-top: 50px;
}
div.nosearchresults ul {
    line-height: 150%;
}
span.warning {
    color: red;
}
.sabhistorysuccess {		
    background-color: #E8FBE6 !important;		
	}		
	.sabhistoryfail {		
    background-color: #FFEBE6 !important;		
}
/*! Newznab tooltip style */

.ui-tooltip-newznab .ui-tooltip-titlebar,
.ui-tooltip-newznab .ui-tooltip-content {
    border-color: #90D93F;
    color: #7727DB;
}
.ui-tooltip-newznab .ui-tooltip-content {
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') repeat;
}
.ui-tooltip-newznab .ui-tooltip-titlebar {
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==') repeat;
    color: #0081FF;
    font-size: 1.2em;
}
.ui-tooltip-newznab .ui-state-default .ui-tooltip-icon {
    background-position: -42px 0;
}
table.ui-tooltip-newznab th {
    vertical-align: top;
    text-align: right;
}
ul.ui-tooltip-newznab li {
    text-align: left;
}
.rarfilelist {
    cursor: pointer;
}
/*.tooltiphead {background-color:#A9DB66; padding:5px;color:white; font-weight:bold; margin:-5px -10px 5px -10px;}*/

.ui-tooltip ul {
    padding: 0;
    margin: 0;
    line-height: 160%;
}
.ui-tooltip li {
    list-style-type: none;
}
.tabs {
    padding: 0;
    list-style: none;
}
.tabs li {
    float: left;
    border: 1px solid #AAA;
    margin-bottom: -1px;
    margin-right: 5px;
    overflow: hidden;
    background: #F4F4F4;
}
.tabs li a {
    padding: 0 10px 0 10px;
}
.tabs li.active {
    background: #DDD;
    border-bottom: 1px solid #EEE;
}
/*
movie, console and music modals with backdrop images.
*/
/* 
icons and multioperation buttons
*/

input.nzb_check_all {
    margin-left: 5px;
}
#nzb_multi_operations_form {
    clear: both;
}
div.nzb_multi_operations {
    color: #0081FF;
    display: inline;
    text-align: right;
    clear: both;
}
div.nzb_multi_operations input {
    color: #7727DB;
    background: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAK0lEQVQImWMUFBT8z8vLywADTMLCwgzIgOnXr18MDAwMDJ8/f4YIwGRgKgEGSwea/hkUqwAAAABJRU5ErkJggg==');
    border: 1px solid #178cff;
}
div.nzb_multi_operations input:hover {
    color: #FFF200;
    border: 1px solid #00ffc4;
    cursor: pointer;
}
div.icon {
    width: 16px;
    height: 16px;
    background-repeat: no-repeat;
    cursor: pointer;
    position: relative;
    float: left;
    margin: 2px;
}
table.data td.icons div.icon {
    opacity: .20;
}
div.icon_cart {
    background-image: url('data:image/png;base64,');
}
div.icon_cart_clicked {
    background-image: url('data:image/png;base64,');
}
div.icon_nzb {
    background-image: url('data:image/png;base64,');
}
div.icon_nzb_clicked {
    background-image: url('data:image/png;base64,');
}
div.icon_nzb a {
    text-decoration: none;
    padding-bottom: 2px;
    padding-right: 12px;
}
div.icon_sab {
    background-image: url('data:image/png;base64,');
}
div.icon_sab_clicked {
    background-image: url('data:image/png;base64,');
}

